// src/components/Moon.tsx
import React, { useState, useEffect, useMemo } from 'react';
import styled, { keyframes } from 'styled-components';
import { CelestialBody, Flower, EmotionType } from '../types';
import {
  moonImage,
  starIcon,
  meteorIcon,
  flower1Icon,
  flower2Icon,
  flower3Icon
} from '../assets';

// 月球旋转动画
const rotate = keyframes`
  from { transform: rotate(0deg); }
  to   { transform: rotate(360deg); }
`;

// 星星/流星浮动动画
const float = keyframes`
  0%   { transform: translateY(0); }
  50%  { transform: translateY(-10px); }
  100% { transform: translateY(0); }
`;

// 最外层容器，定位月球及其覆盖层
const MoonContainer = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 300px;
  height: 300px;
  pointer-events: none;
`;

// 月球本体，带旋转
const MoonSphere = styled.div`
  width: 100%;
  height: 100%;
  border-radius: 50%;
  background: url(${moonImage}) no-repeat center center;
  background-size: cover;
  animation: ${rotate} 60s linear infinite;
  box-shadow: inset -25px -25px 40px rgba(0,0,0,0.3);
`;

// 花朵覆盖层，不继承旋转，只做绝对定位
const FlowerOverlay = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  pointer-events: auto;
`;

// 花朵容器，固定位置
const FlowerContainer = styled.div<{
  x: number;
  y: number;
  flowerType: 'flower1' | 'flower2' | 'flower3';
}>`
  position: absolute;
  left: ${p => p.x}px;
  top: ${p => p.y}px;
  width: 32px;
  height: 32px;
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center;
  background-image: ${p => {
    if (p.flowerType === 'flower1') return `url(${flower1Icon})`;
    if (p.flowerType === 'flower2') return `url(${flower2Icon})`;
    return `url(${flower3Icon})`;
  }};
`;

// 星星/流星容器
const CelestialBodyContainer = styled.div<{ x: number; y: number; type: EmotionType }>`
  position: absolute;
  left: ${p => p.x}px;
  top: ${p => p.y}px;
  width: 48px;
  height: 48px;
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center;
  background-image: ${p =>
    p.type === 'positive'
      ? `url(${starIcon})`
      : p.type === 'negative'
      ? `url(${meteorIcon})`
      : `url(${starIcon})`};
  animation: ${float} 6s ease-in-out infinite;
  cursor: pointer;
  pointer-events: auto;
  filter: ${p => (p.type === 'received' ? 'hue-rotate(90deg)' : 'none')};

  &:hover {
    transform: scale(1.2);
    filter: brightness(1.2) ${p => (p.type === 'received' ? 'hue-rotate(90deg)' : '')};
    z-index: 10;
  }
`;

const Tooltip = styled.div`
  position: absolute;
  background: rgba(0, 0, 0, 0.8);
  color: #fff;
  padding: 6px 10px;
  border-radius: 4px;
  font-size: 12px;
  max-width: 180px;
  pointer-events: none;
  opacity: 0;
  transition: opacity 0.2s;

  ${CelestialBodyContainer}:hover & {
    opacity: 1;
  }
`;

interface MoonProps {
  celestialBodies: CelestialBody[];
  flowers?: Flower[];
}

export const Moon: React.FC<MoonProps> = ({ celestialBodies, flowers = [] }) => {
  const [positions, setPositions] = useState<Record<string, { x: number; y: number }>>({});

  // 计算 overlay 相对于窗口的位置
  const overlayOffset = useMemo(() => ({
    x: window.innerWidth / 2 - 150,
    y: window.innerHeight / 2 - 150
  }), []);

  useEffect(() => {
    const w = document.documentElement.clientWidth;
    const h = document.documentElement.clientHeight;
    const moonX = w / 2;
    const moonY = h / 2;
    const moonR = 150;
    const margin = 50;
    const topGap = 100;
    const bottomGap = 150;
    const minX = margin;
    const maxX = w - 48 - margin;
    const minY = topGap + margin;
    const maxY = h - bottomGap - margin;

    const newPos: Record<string, { x: number; y: number }> = {};
    celestialBodies.forEach(body => {
      if (positions[body.id]) {
        newPos[body.id] = positions[body.id];
      } else {
        let x: number; let y: number; let cnt = 0;
        do {
          x = Math.random() * (maxX - minX) + minX;
          y = Math.random() * (maxY - minY) + minY;
          cnt++;
        } while (cnt < 100 && Math.hypot(x - moonX, y - moonY) < moonR + 60);
        newPos[body.id] = { x, y };
      }
    });
    setPositions(newPos);
  }, [celestialBodies]);

  return (
    <MoonContainer>
      {/* 月球本体，带旋转 */}
      <MoonSphere />

      {/* 花朵覆盖层，不随旋转 */}
      <FlowerOverlay>
        {flowers.map(f => {
          const localX = f.position.x - overlayOffset.x;
          const localY = f.position.y - overlayOffset.y;
          return (
            <FlowerContainer
              key={f.id}
              x={localX}
              y={localY}
              flowerType={f.style as 'flower1' | 'flower2' | 'flower3'}
            />
          );
        })}
      </FlowerOverlay>

      {/* 星星／流星 */}
      {celestialBodies.map(body => (
        <CelestialBodyContainer
          key={body.id}
          x={positions[body.id]?.x || 0}
          y={positions[body.id]?.y || 0}
          type={body.type}
        >
          <Tooltip>{body.content}</Tooltip>
        </CelestialBodyContainer>
      ))}
    </MoonContainer>
  );
};
